import css from './Loader.module.css';
import { Component } from 'react';

class Loader extends Component {
    render() {
      return (
        <>
          <div className={css.Overlay}>
            <div className={css.Modal}>
              <img src="" alt="" />
            </div>
          </div>
        </>
      );
    }
  }
  export default Loader;
